import React from "react";
import Gifting from "../GIF/Gifting.gif";
import "../App.css";
export const MainCTA = () => {
  return (
    <div className="row flex-lg-row-reverse align-items-center g-5 py-5">
      <div className="col col-sm-8 col-lg-6">
        <img
          src={Gifting}
          className="d-block mx-lg-auto img-fluid"
          alt="Bootstrap Themes"
          width={1000}
          loading="lazy"
        />
      </div>
      <div className="col-lg-6">
        <h1 className="display-5 fw-bold lh-1 mb-3">Happiness is a gift</h1>
        <p className="lead">
          {" "}
          Show your love with one of our large & small gift sets, uniquely
          created to bring happiness to someone you care about!
        </p>
        <div className="d-grid gap-2 d-md-flex justify-content-md-start">
          <button type="button" className="btn btn-primary btn-lg px-4 me-md-2">
            Primary
          </button>
          <button
            type="button"
            className="btn btn-outline-secondary btn-lg px-4"
          >
            Default
          </button>
        </div>
      </div>
    </div>
  );
};
